  mongoClient.connect(connectionString, (err, clientObj)=&gt;{
    if (!err) {
      var database = clientObj.db(&quot;reactdb&quot;);
      database.collection(&quot;tblusers&quot;).find({}).toArray((err, documents) =&gt; {
          if (!err) {
            res.send(documents);
          }
        })
    }
  })
});

