<p>The document is sent by the golang back end to a react client. The user then edits some fields and hits save.</p>
<p>I tried this:</p>
<pre><code>filter := bson.D{}
result, err := sequencesCollection.ReplaceOne(c, filter, document)
if err != nil {
    log.Fatal(err)
}
</code></pre>
<p>It keeps telling me that the document's _id has changed:</p>
<blockquote>
<p>write exception: write errors: [After applying the update, the (immutable) field '_id' was found to have been altered to _id: &quot;64d50067a145130ccf0521af&quot;]</p>
</blockquote>
<p>I think I am messing up the _id field somehow. I get the document like this:</p>
<pre><code>func getSequence(ctx *gin.Context) {
id := ctx.Params.ByName(&quot;id&quot;)

_id, err := primitive.ObjectIDFromHex(id)
if err != nil {
    log.Fatal(err)
}

var sequence bson.M
if err := sequencesCollection.FindOne(ctx, bson.M{&quot;_id&quot;: _id}).Decode(&amp;sequence); err != nil {
    log.Fatal(err)
}

fmt.Printf(&quot;the sequence: %s&quot;, sequence)

ctx.JSON(http.StatusOK, sequence)
}
</code></pre>
<p>Seems to work. I can see the the _id field is an ObjectID</p>
<blockquote>
<p>the sequence: map[_id:ObjectID(&quot;64d50067a145130ccf0521af&quot;) currentEnvelopeId: currentPanelId:ARP deviceFamilyId:Mini/Monologue division:%!s(float64=8) envelopes:[] length:%!s(float64=3) midiDevicePreferences:map[inputs:[] outputs:[]] midiSettings:map[midiInputChannelNum:%!s(float64=-1) midiInputDeviceId: midiInputDeviceName:omni midiOutputChannelNum:%!s(float64=0) midiOutputDeviceId: midiOutputDeviceName:none midiRemoteChannelNum:%!s(float64=-1) midiRemoteDeviceId:] name:New Sequence numSteps:%!s(float64=3) packs:[] playOrder:forward rawSteps:[map[gateLength:%!s(float64=0.5) note:%!s(float64=60) velocity:%!s(float64=100)] map[gateLength:%!s(float64=0.5) note:%!s(float64=60) velocity:%!s(float64=100)] map[gateLength:%!s(float64=0.5) note:%!s(float64=72) velocity:%!s(float64=100)]] scaleSettings:map[customNotes:[] root:%!s(float64=0) scaleType:Chromatic] searchHints:map[] skin:map[backgroundColor:%!s(float64=1.671168e+07) velocityColor:%!s(float64=1.5598465e+07)] stepFilters:[] steps:[map[gateLength:%!s(float64=0.5) note:%!s(float64=60) velocity:%!s(float64=100)] map[gateLength:%!s(float64=0.5) note:%!s(float64=60) velocity:%!s(float64=100)] map[gateLength:%!s(float64=0.5) note:%!s(float64=72) velocity:%!s(float64=100)]] sysexPresetAddress:map[packId:localpack presetId:0 typeId:sysex] tempo:%!s(float64=120) user_id:62d93722d51a8f9b6685d3f6 user_name: viewSettings:map[]]</p>
</blockquote>
<p>I am trying to put the document like this:</p>
<pre><code>func putSequence(c *gin.Context) {
jsonData, err := io.ReadAll(c.Request.Body)
fmt.Printf(&quot;jsonData: %s\n&quot;, jsonData)

var document bson.M = bson.M{}
err = json.Unmarshal(jsonData, &amp;document)
if err != nil {
    log.Fatal(err)
}

_id := document[&quot;_id&quot;]
filter := bson.D{{Key: &quot;_id&quot;, Value: _id}}
result, err := sequencesCollection.ReplaceOne(c, filter, document)
if err != nil {
    log.Fatal(err)
}

c.JSON(http.StatusOK, result.UpsertedCount)
}
</code></pre>
<p>I post the original document like this:</p>
<pre><code>func postSequence(c *gin.Context) {
jsonData, err := io.ReadAll(c.Request.Body)

var document bson.M = bson.M{}
err = json.Unmarshal(jsonData, &amp;document)
if err != nil {
    log.Fatal(err)
}

result, err := sequencesCollection.InsertOne(c, document)
if err != nil {
    log.Fatal(err)
}

c.JSON(http.StatusOK, result.InsertedID)
}
</code></pre>
<p>I guess my question is ... how do I preserve the _id field when going to the client and back via json? Or just, how do I replace the document?</p>; Answer: Thanks @ThomasWalpole - I just blindly set both the current and javascript driver as `:webkit_billy`. I'm not using JS for this spec, but I assume it should work either way since `:webkit_billy` will always be the driver? As for the value, I tried to place a `binding.pry` inside the `Proc` block to check the value like you suggested. That `binding.pry` never triggers, so it's not even calling that Proc. Could it be the URL I'm proxying is incorrect in some way? I just provided the base URL+URI but in reality I redirect to that with some query params. Assumed I didn't need to include params.

