Mongoose creating too many connections in NextJS<p>I've been using Mongoose to connect Mongodb with my nextjs application, everything was working fine in the development mode, but when I deployed the project, even a single user (me) is taking around 60 to 80 connections. And when I shared the link with 3/4 of my friends, the connection has reached 500 connections limit.</p>
<p>Here's my initDB file's code:</p>
<pre><code>import mongoose from &quot;mongoose&quot;;

const MONGO_URI = process.env.MONGO_URI;

if (!MONGO_URI) {
  throw new Error(&quot;Error Code: grx30xd33d&quot;);
}

let cached = global.mongoose;
if (!cached) {
  cached = global.mongoose = { conn: null, promise: null };
}

async function initDB() {
  if (cached.conn) {
    return cached.conn;
  }

  if (!cached.promise) {
    const opts = {
      bufferCommands: false,
      useNewUrlParser: true,
      useUnifiedTopology: true,
      maxPoolSize: 50,
      wtimeoutMS: 2500,
      useNewUrlParser: true,
    };

    mongoose.set(&quot;strictQuery&quot;, false);
    cached.promise = mongoose.connect(MONGO_URI, opts).then((mongoose) =&gt; {
      return mongoose;
    });
  }

  try {
    cached.conn = await cached.promise;
  } catch (e) {
    cached.promise = null;
    throw e;
  }

  return cached.conn;
}

export default initDB;
</code></pre>
<p>And this is my page which is using the initDB.</p>
<pre><code>import initDB from &quot;../../../helpers/initDB&quot;;
import directorySchema from &quot;../../../models/directory/directorySchema &quot;;

export default async function handler(req, res) {
  await initDB();

  return new Promise(async (resolve, reject) =&gt; {
    try {
      const userProf = await directorySchema
        .find()
        .limit(20)
        .sort({ _id: -1 })
        .then(async (response) =&gt; {
          if (response !== null) {
            res.json({
              success: true,
              data: response,
              message: &quot;Data Fetched Successfully&quot;,
            });
          } else {
            return res.json({
              success: false,
              message: &quot;Invalid data response&quot;,
            });
          }
        })
        .catch((error) =&gt; {
          console.log(error);
          res.json(error);
          res.status(405).end();
          return reject();
        });
    } catch (error) {
      console.log(error);
    }
  });
}
</code></pre>
<p>The response is working fine, I'm getting the required response, but the connection limit is reaching in mongodb.</p>
<p>Here's the screenshot of connection while writing this question.
<a href="https://i.stack.imgur.com/26RvP.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/26RvP.png" alt="enter image description here" /></a></p>

